Page:
  Page_1:
    owner_id: sfGuardUserProfile_5
    title: 'Vincent van Gogh'
    description: 'Vincent Willem van Gogh (Zundert, Países Bajos, 30 de marzo de 1853 – Auvers-sur-Oise, Francia, 29 de julio de 1890) fue un pintor neerlandés, uno de los principales exponentes del postimpresionismo. Pintó 900 cuadros (de ellos 27 autorretratos y 148 acuarelas) y 1.600 dibujos. La figura central en su vida fue su hermano menor Theo, quien continua y desinteresadamente le prestó apoyo financiero. La gran amistad entre ellos está documentada en las numerosas cartas que se intercambiaron desde agosto de 1872. Para Theo fueron unas 650 de sus 800 cartas conservadas; las otras son correspondencia con amigos y familiares.'
    photo: 7abf03ea277aaf1f5f29e87bcf1667bda9ca35f0.jpg
    updated_at: '2012-01-01 01:01:01'
  Page_2:
    owner_id: sfGuardUserProfile_5
    title: 'Francisco Goya'
    description: 'Francisco José de Goya y Lucientes (Fuendetodos, Zaragoza, 30 de marzo de 1746 – Burdeos, Francia, 16 de abril de 1828), fue un pintor y grabador español. Su obra abarca la pintura de caballete y mural, el grabado y el dibujo. En todas estas facetas desarrolló un estilo que inaugura el Romanticismo. El arte goyesco supone, asimismo, el comienzo de la Pintura contemporánea, y se considera precursor de las vanguardias pictóricas del siglo XX.'
    photo: ebb7cfdedbfd4ce8580f7e14782814bebd501831.jpg
    updated_at: '2012-01-01 01:01:01'
  Page_3:
    owner_id: sfGuardUserProfile_5
    title: 'Paul Cézanne'
    description: 'Paul Cézanne (19 de enero de 1839 – 22 de octubre de 1906) fue un pintor francés postimpresionista, considerado el padre de la pintura moderna, cuyas obras establecieron las bases de la transición entre la concepción artística decimonónica hacia el mundo artístico del siglo XX, nuevo y radicalmente diferente. Sin embargo, mientras vivió, Cézanne fue un pintor ignorado que trabajó en medio de un gran aislamiento. Desconfiaba de los críticos, tenía pocos amigos y, hasta 1895, expuso sólo de forma ocasional. Fue un «pintor de pintores», que la crítica y el público ignoraban, siendo apreciado sólo por algunos impresionistas y, al final de su vida, por la nueva generación.'
    photo: 3cf30904a07770a7a2f2096294967fc753e64994.jpg
    updated_at: '2012-01-01 01:01:01'
  Page_4:
    owner_id: sfGuardUserProfile_9
    title: 'Wolfgang Amadeus Mozart'
    description: 'Wolfgang Amadeus Mozart (Salzburgo, 27 de enero de 1756 – Viena, 5 de diciembre de 1791), fue un compositor y pianista austriaco, maestro del Clasicismo, considerado como uno de los músicos más influyentes y destacados de la historia.'
    photo: 37ec538b5c57608880909afbcdbcf88ac6edf422.jpg
    updated_at: '2012-01-01 01:01:01'
